// Photography.jsx
import React from 'react';
import './Photography.css';

const Photography = () => {
  return (
    <div className="photography">
      <h1>Photography</h1>
      
      {/* Embed Redbubble Store */}
      <div className="redbubble-store">
        <iframe 
          src="https://www.redbubble.com/people/krood16/shop" 
          width="100%" 
          height="800" 
          frameborder="0" 
          allowfullscreen>
        </iframe>
      </div>
      
      <div className="gallery">
        <img src="photo1.jpg" alt="Photo 1" />
        <img src="photo2.jpg" alt="Photo 2" />
        <img src="photo3.jpg" alt="Photo 3" />
      </div>
    </div>
  );
};

export default Photography;
